Fame in China

Arts Documentary hosted by Wu Hao, published by BBC broadcasted as part of BBC Storyville series in 2013 - English narration


Information
------------------------------

Chronicles the staging of the musical Fame by the senior class at China's top drama academy, China's first official collaboration with Broadway. It unfolds as a unique coming-of-age story with Chinese characteristics. Fame is their graduation showcase and much is at stake. During the eight-month process, the students compete for roles, strive to meet the expectations of the American director and prepare to graduate into a cutthroat and corrupt showbusiness.
Part of China's 'single-child' generation, they were spoiled growing up but now feel the pressure of fulfilling the failed dreams of their parents. They must confront complex social realities so different from their parents' generation and in the process of staging Fame, negotiate their own path to success in today's rapidly shifting China.

